import React,
      { Component } from 'react';
import { Link } from 'react-router-dom'
import Typing from 'react-typing-animation';

class CenterTitle extends Component {

  constructor( props )
  {

    super( props );

  }

  render() {

    let { title, typing_arr_descriptions } = this.props;
    return (
      <div data-component="cover-page-center">

        <div className="container-page hidden">

          <p data-title>Um capital de risco que vale por uma carteira inteira</p>
          <p data-description>Um ambiente onde e possivel obter lucros de ate 110%/m</p>

        </div>
      </div>
    );
  }
}
export default CenterTitle;
